class Solution:
    def canJump1(self, nums: list[int]) -> bool:
        if len(nums) == 1:
            return True
        reachable = set()
        reachable.add(0)
        i = 0
        prev_visited = 0
        visited = set()
        while i < len(nums) - 1:
            start_index = i
            prev_start = nums[start_index]
            if start_index not in reachable:
                i += 1
                continue
            nums[start_index] = min(nums[start_index], len(nums) - start_index)
            if start_index in visited:
                nums[start_index] -= 1
            while nums[start_index] > prev_visited:
                current_pos = start_index
                while current_pos < len(nums) - 1:
                    current_pos += nums[current_pos]
                    if current_pos in visited:
                        reachable.add(current_pos)
                        visited.add(current_pos)
                        break
                    if current_pos >= len(nums) or nums[current_pos] == 0:
                        break
                    reachable.add(current_pos)
                    visited.add(current_pos)
                if current_pos == len(nums) - 1:
                    return True

                nums[start_index] -= 1
            prev_visited = prev_start - 1
            i += 1
        return False

    def canJump2(self, nums: list[int]) -> bool:
        if len(nums) == 1:
            return True
        if nums[0] == 0:
            return False
        first = 0
        for num in nums:
            if num == 0:
                first += 1
            else:
                nums = nums[first:]
                break
        max_ind = len(nums) - 1
        dp = {max_ind: True}
        ind = max_ind - 1
        while ind > 0 and nums[ind] > 0:
            dp[ind] = True
            ind -= 1
        if ind == 0:
            return True
        while ind >= 0:
            steps = nums[ind]
            for good_pos in dp:
                if good_pos - ind <= steps:
                    dp[ind] = True
                    break
            ind -= 1
        return dp.get(0) is not None

    def canJump(self, nums: list[int]) -> bool:
        goal = len(nums) - 1
        for i in range(len(nums)-1, -1, -1):
            if i + nums[i] >= goal:
                goal = i
        return True if goal == 0 else False

